// src/App.js
import React from 'react';
import Header from './Header';
import Sidebar from './Sidebar';
import Calendar from './Calendar';
import GlobalStyle from './GlobalStyle';
import { AppWrapper, MainContent } from './App.styles';

const App = () => {
  return (
    <AppWrapper>
      <GlobalStyle />
      <Header />
      <MainContent>
        <Sidebar />
        <Calendar />
      </MainContent>
    </AppWrapper>
  );
};

export default App;
